import { Container, Div, Button, Image } from './styles';
import Logo from '../../assets/Logo.png';

interface HeaderProps {
  openModal: () => void;
}

export default function Header({ openModal }: HeaderProps) {
  return (
    <Container>
      <Div>
        <Image src={Logo}  />
        <Button
          type="button"
          onClick={openModal}
        >
        </Button>
      </Div>
    </Container>
  )
}
